import React from 'react'

import axios from 'axios'

import { useData } from '../Context/DataContext'

const LivingPlaceRegistrationSendDatas = () => {

    const { setValues, data } = useData()

    console.log('data', data)

    const json = JSON.stringify(data)

    console.log('json', json)

    const registryLivingPlace = (json) => {
        const res = axios.post('http://10.0.4.5:8000/api/v1/vhe/introduction/', json)
        console.log(res)
    }

    registryLivingPlace(json)

    return (
        <>
            Datas sent
        </>
    )
}

export default LivingPlaceRegistrationSendDatas
